-- Procedure structure for projectList
-- ----------------------------
DROP PROCEDURE IF EXISTS `projectList`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `projectList`(projectName varchar(50),
	projectId int(5),
	projectOwner varchar(50),
	projectMembers VARCHAR(50))
begin
	select count(*) into @qty from project_assigned WHERE project_id=projectId AND `owner`=projectOwner;
	if (@qty > 0)
	then
		UPDATE project_assigned SET `name`=projectName WHERE project_id=projectId AND `owner`=projectOwner AND `name` <> projectName;
	else
	end if;
end
;;
DELIMITER ;
